import React from 'react';

function Playlist({ title, favorites, tracks }) {
  return (
    <div>
      <h3></h3>
      {tracks.map((track) => (
        <div>{`${track.title} - ${track.artist}`}</div>
      ))}
    </div>
  );
}

export default Playlist;
